import React, { useContext, useState }  from 'react';
import Login from '../components/homePage/Login';
import Register from '../components/homePage/Register';
import MapsTable from '../components/homePage/MapsTable';
import { UserContext } from '../components/UserContext';

function Home() {
  const {user, setUser} = useContext(UserContext);
  const [active, setActive] = useState("LoginCard");
  const tableEl = document.querySelector('table');
  tableEl.addEventListener('click',onClickPlay);

  let card;
  let gomb;
  if (active === "LoginCard" ) {
    card = <Login />
    gomb = <button onClick={() => setActive("RegisterCard")}>Register</button>
  } else {
    card = <Register />
    gomb = <button onClick={() => setActive("LoginCard")}>Login</button>
  }

  function onClickPlay(e){
    if(!e.target.classList.contains('playBtn')){
      return
    }
    alert('clock')
  }
  return (
    <div className='Home'>
      {user ? (<MapsTable/>):(
         <div>
         {card}
         {gomb}
         </div>

      )}

    </div>

  );
}

export default Home;
